const fs = require('fs');
const base64ToPdf = require('../util/base64ToPdf.util');

const str = 'data:image/jpeg;base64,';
const invalidStr = '';

describe('base64ToPdf', () => {
    // test for failure
    it('should throw Error with message \'Cannot read property "length" of null\' when no params were passed', async () => {
        try {
            const expected = await base64ToPdf(invalidStr);
            // Fail test if above expression doesn't throw anything.
            expect(expected).toThrow(TypeError);
        } catch (e) {
            expect(e.message).toBe("Cannot read property 'length' of null");
        }
    });

    // test for success
    it('should convert base64 string to pdf', async () => {
        const expected = await base64ToPdf(str);
        fs.unlinkSync(expected);
        expect(typeof (expected)).toBe('string');
    });
});